Step-by-step reasoning:
• We begin with a key psychological mechanism: responders evaluate offers by comparing the actual monetary share (split_self) to a fairness benchmark. This benchmark is based on proportional token contributions (i.e. token_self relative to total tokens) scaled by the combined earnings. A discrepancy between the fair share and the offered share (r – split_self) should reduce the offer’s attractiveness.
• Next, instead of applying a hard, piecewise penalty or a quadratic function, we propose a smooth penalty function that gradually “penalizes” offers that fall below the benchmark. To obtain a smooth, continuously differentiable penalty we use the softplus transformation (i.e. ln[1 + exp(x)]). In our context, for a perceived “unfair” shortfall, the penalty becomes large, while if the offer meets or exceeds the fair share, the transformed value remains small.
• The psychological interaction captured is that the responder’s utility increases with the offered amount (split_self) and is shifted by a baseline bias (mu), but any shortfall relative to the fair share (r) is subtracted via a softplus function. This yields a punishment that is gradual and nonlinear, consistent with observation in social decision-making.
• Two learnable parameters are used:
  ◦ mu: a baseline utility/bias.
  ◦ lambda: a sensitivity (or “inequity aversion”) parameter scaling the penalty.
• All observable variables from the dataset are used to compute the fairness benchmark: combined_earning, token_self, and token_opp, ensuring our model is applicable using only provided data.
• The final utility U of accepting an offer is computed as the offered share plus the bias minus the penalty. Negative utility indicates an offer that is perceived as less attractive.

Below is the formal mathematical model specification and the variable descriptions.

<MODEL>
Let 
  r = combined_earning × (token_self / (token_self + token_opp))
  diff = r − split_self
Then the utility is given by:
  U = mu + split_self − lambda × ln(1 + exp(diff))
</MODEL>

