def simulate_model(trial_data, mu=0, lambd=1):
    utility_values = []
    for trial in trial_data:
        try:
            combined_earning = trial['combined_earning']
            token_self = trial['token_self']
            token_opp = trial['token_opp']
            split_self = trial['split_self']

            if token_self + token_opp ==0:
                r = 0
            else:
                r = combined_earning * (token_self / (token_self + token_opp))
            diff = r - split_self
            utility = mu + split_self - lambd * math.log(1 + math.exp(diff))
            utility_values.append(utility)
        except (KeyError, ZeroDivisionError, OverflowError) as e:
            print(f"Error processing trial {trial}: {e}")
            utility_values.append(float('nan')) # Handle errors gracefully

    return utility_values
